import React from 'react';

export default class App extends React.Component {

  state = {
    billionaires: [],
  }

  componentDidMount() {
    fetch('https://v11v9.sse.codesandbox.io/billionaires')
    .then(resonse => {
        return resonse.json()
    }).then(result => {
      this.setState({
        billionaires: result
      })
        console.log(result);
    });

  }

  render() {
    return (
      <div>
         <h1>Hello World</h1>
    <ol>
      {this.state.billionaires.map((person) => {
      return <p>{person.name}</p>})}
      </ol>
      </div>
    ) 
  }
}


